import React from "react";
import { Route } from "react-router-dom";

import { Login, Registration } from "../pages/index";

const AuthRoutes = () => {
  return (
    <>
      <Route path="/login" element={<Login />} />
      <Route path="/registration" element={<Registration />} />
    </>
  );
};

export default AuthRoutes;
